	add("soldiery", "{\"term\":\"soldiery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|soldier|y|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Soldiers considered as a group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 790\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Now they could see the point of having a uniformed driver to conduct them, for he would bear the brunt of such encounters with the \u0027\u0027soldiery\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The profession or skill of being a soldier\", \"priority\":4}]}, \"synonyms\":{}}");

	add("solecism", "{\"term\":\"solecism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027σολοικισμός\u0027 () from \u0027σόλοικος\u0027 (speaking incorrectly) from \u0027σόλοι\u0027 () an w:Ancient Athens|ancient Athenian colony in Cilicia whose inhabitants spoke a dialect that Athenians regarded as a corrupted and barbarous form of Attic|Attic Greek.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Erroneous or improper usage; absurdity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1783\u0027\u0027 July 8, w:George George Washington, \u0027s:Letter, George Washington to Rev. William Letter to Rev. William Gordon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"to suppose that the general concern of this Country can be directed by thirteen heads, or one head without competent powers, is a \u0027\u0027solecism\u0027\u0027, the bad effects of which every Man who has had the practical knowledge to judge from, that I have, is fully convinced of; tho\u0027 none perhaps has felt them in so forcible, and distressing a degree\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, w:Noah Haynes Noah Haynes Swayne, w:Supreme Court of the United Supreme Court of the United States, \u0027s:Smythe v. Fiske/Opinion of the Smythe v. Fiske: Opinion of the Court\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Why leave the non-enumerated articles, covered by the act of 1864, subject only to this lower rate of duty? Why this distinction? Such a result would, we think, be a \u0027\u0027solecism\u0027\u0027, and contrary to the spirit and purpose of the act. It cannot reasonably be supposed that such was the intent of the clause in question\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, w:Henry Henry James, \u0027s:The Portrait of a Lady/Chapter The Portrait of a Lady\u0027, Chapter IV\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For this reason she was fond of seeing great crowds and large stretches of country, of reading about revolutions and wars, of looking at historical pictures--a class of efforts as to which she had often committed the conscious \u0027\u0027solecism\u0027\u0027 of forgiving them much bad painting for the sake of the subject\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Error in the use of language\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, \u0027s:1911 Encyclopædia Metaphor\u0027, article in \u0027w:Encyclopædia Britannica Eleventh Encyclopædia Britannica Eleventh Edition\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0026quot;simple\u0026quot; metaphor, such as the instance given, becomes the \u0026quot;continued\u0026quot; metaphor when the analogy or similitude is worked out in a series of phrases and expressions based on the primary metaphor; it is in such \u0026quot;continued metaphors\u0026quot; that the \u0027\u0027solecism\u0027\u0027 of \u0026quot;mixed\u0026quot; metaphors is likely to occur\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In written language, the intentional use of misspelling and/or incorrect grammar to effect the vernacular of a particular dialect\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A faux pas or breach of etiquette; a transgression against the norms of expected behavior\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1778\u0027\u0027, w:Frances Fanny Burney, \u0027s:Evelina/Letter Evelina: Or the History of a Young Lady\u0027s Entrance into the World, Letter LXVIII: EVELINA TO THE REV. MR. VILLARS. Clifton, Sept. 28th\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"quot;Best young woman!\u0026quot; repeated Mr. Lovel; \u0026quot;\u0027pon honour, Jack, you have made a most unfortunate speech; however, if Lady Louisa can pardon you,-and her Ladyship is all goodness,-I am sure nobody else can; for you have committed an outrageous \u0027\u0027solecism\u0027\u0027 in good manners.\u0026quot\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, \u0027s:Catholic Encyclopedia (1913)/Ecclesiastical Ecclesiastical Architecture\u0027, article in \u0027w:Catholic Catholic Encyclopedia\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"To build a church for the admiration of \u0026quot;the man the street\u0026quot;, who sees it from outside, or of the tourist who pays it a passing visit, or of the artist, or of anyone else whatsoever except that of the faithful who use the church for prayer, the hearing of Mass, and the reception of the sacraments, is to commit a \u0027\u0027solecism\u0027\u0027 in the liturgy of all the material arts\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:H. L. H. L. Mencken, \u0027s:The American Language/Chapter The American Language\u0027, Chapter 20: Honorifics, \u0027footnote\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"In the South every negro preacher is \u0027ex officio\u0027 a D.D., and is commonly addressed as \u0027Doctor\u0027. This enables white Southerners to show a decent respect for his sacred office, and yet avoid the \u0027\u0027solecism\u0027\u0027 of calling him \u0027Mister\", \"priority\":18}]}, \"synonyms\":{}}");

