	add("solipsism", "{\"term\":\"solipsism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{compound|solus|t1\u003dalone|ipse|t2\u003dself|lang\u003dla|nocat\u003d1}} {{suffix||ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The theory that the self is all that exists or that can be proven to exist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Self-absorption, an unawareness of the views or needs of others; self-centeredness; egois\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027solipsism\u0027\u0027 that too frequently infects high commands has no place on a battlefield\", \"priority\":3}]}, \"synonyms\":{}}");

	add("solitaire", "{\"term\":\"solitaire\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|solitaire|lang\u003den}}, ultimately from Latin \u0027sōlitārius\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who lives alone; a recluse or hermit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"he really wishes he had never beheld you, nor yours. You have spoiled him for a \u0027\u0027solitaire\u0027\u0027, and a book, all the days of his life; and put him into such a condition, that he thinks of nothing, and enquires of nothing but after a person who has nothing to say to him, and has left him for ever\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A game for one person, played on a board with pegs or balls, in which the object is, beginning with all the places filled except one, to remove all but one of the pieces by \u0026quot;jumping\u0026quot;, as in draughts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of various card games that can be played by one person. Called patience in the rest of the world\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An extinct bird related to dodo, Rodrigues solitaire, that lived on the island of Rodrigues\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An extinct bird formerly believed to be related to the dodo, more precisely Réunion solitaire, now preferably Réunion ibis\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One of several American species of bird in the genus \u0027Myadestes\u0027 in the thrush family\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A gem set on its own\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A black neck ribbon worn with a bag wig in the 18th century\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1771\u0027\u0027, Tobias Smollett, \u0027Humphry Clinker\u0027, Penguin Classics, 1985, p.191\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The fellow wears a \u0027\u0027solitaire\u0027\u0027, uses paint, and takes rappee with all the grimace of a French marquis\", \"priority\":11}]}, \"synonyms\":{}}");

	add("solitariness", "{\"term\":\"solitariness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|solitary|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being solitary\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I saw a Deane of S. \u0027Hillarie\u0027 of Poictiers, reduced by reason and the incommoditie of his melancholy to such a continuall \u0027\u0027solitarinesse\u0027\u0027, that when I entered into his chamber he had never removed one step out of it in two and twenty yeares before\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bishop Joseph Hal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"So much as doing good is better than not doing evil, will I account Christian good fellowship better than an eremitish and melancholy \u0027\u0027solitariness\", \"priority\":4}]}, \"synonyms\":{}}");

