	add("solitude", "{\"term\":\"solitude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027solitude\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Aloneness; state of being alone or solitary, by oneself\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lonely or deserted place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1813\u0027\u0027, w:Lord Lord Byron, \u0027w:The Bride of Bride of Abydos\u0027, Canto 2, stanza 20\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mark where his carnage and his conquests cease! \u0026lt;br /\u0026gt; He makes a \u0027\u0027solitude\u0027\u0027, and calls it \u0026amp;mdash; peace\", \"priority\":4}]}, \"synonyms\":{}}");

