	add("solomon", "{\"term\":\"solomon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\"], \"text\":\"From Latin {{m|la|Solomōn}}, from Ancient greek (to 1453) {{m|grc|Σολομών}}, from Hebrew \u0027שְׁלֹמֹה\u0027 from \u0027שָׁלוֹם\u0027 (tr\u003dshalom)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the Old Testament and Quran, a king of Israel famous for his wisdom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And there came of all people to hear the wisdom of \u0027\u0027Solomon\u0027\u0027, from all kings of the earth, which had heard of his wisdom\", \"priority\":2}]}, \"synonyms\":{}}");

	add("solstice", "{\"term\":\"solstice\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027solstice\u0027 from Latin \u0027solstitium\u0027 from \u0027sol\u0027 (sun) + \u0027sto\u0027 (stand) (as in English \u0027solar\u0027 and \u0027resist\u0027 , from \u0027sistō\u0027 (i stand still) both from Proto-indo-european roots.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the two points in the ecliptic at which the sun is furthest from the celestial equator. This corresponds to one of two days in the year when the day is either longest or shortest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Capt Sp Meek, [https://books.google.com/books?id\u003dZNrtnH9kvYYC\u0026amp;pg\u003dPP8\u0026amp;dq\u003dsolstice\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ved\u003d0CD4Q6AEwBji0AWoVChMI6YaS8uWsxwIVkiqICh32vgD\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dsolstice\u0026amp;f\u003dfalse The Solar Magnet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The point at which the sun is nearest to the south pole we call the winter \u0027\u0027solstice\u0027\u0027, and the opposite point, the summer \u0027\u0027solstice\", \"priority\":4}]}, \"synonyms\":{}}");

	add("solution", "{\"term\":\"solution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027solucion\u0027 (French: \u0027solution\u0027 , from Latin {{m|la|solūtiōnem}}, accusative singular of {{m|la|solūtiō}}, from the verb {{m|la|solvō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A homogeneous mixture, which may be liquid, gas or solid, formed by dissolving one or more substances\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act, plan or other means, used or proposed, to solve a problem\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The answer to a problem\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A product, service or suite thereof\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Satisfaction of a claim or debt\", \"priority\":5}]}, \"synonyms\":{}}");

	add("solutionism", "{\"term\":\"solutionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|solution|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that all difficulties have benign solutions, often of a technocratic nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The providing of a solution or solutions to a customer or client\", \"priority\":2}]}, \"synonyms\":{}}");

	add("solutrean", "{\"term\":\"solutrean\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027solutréen\u0027 named in 1872 by Gabriel de Mortillet after a prehistoric site situated by the Rock of Solutré.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the final stages of the Paleolithic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("solvency", "{\"term\":\"solvency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|solvent|cy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of having enough funds or liquid assets to pay all of one\u0027s debts; the state of being solvent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("solvent", "{\"term\":\"solvent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027solvent\u0027 from Latin \u0027solventem\u0027 accusative singular of \u0027solvens\u0027 present participle of \u0027solvō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A liquid that dissolves a solid, liquid, or gaseous solute, resulting in a solution\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dFurthermore, this increase in risk is comparable to the risk of death from leukemia after long-term exposure to benzene, another \u0027\u0027solvent\u0027\u0027, which has the well-known property of causing this type of cancer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which resolves\", \"priority\":3}]}, \"synonyms\":{}}");

